// @lc code=start
/**
 * @param {number[]} nums
 * @return {number}
 */
// 暴力（超时）
var bestRotation1 = function (nums) {
    const n = nums.length, list = nums.concat(nums);
    let k = 0, max = 0;
    for (let i = 0; i < n; i++) {
        let add = 0;
        for (let j = 0; j < n; j++) {
            if (list[i + j] <= j) add++;
        }
        if (max < add) {
            max = add;
            k = i;
        }
    }
    return k;
};
// https://leetcode-cn.com/problems/smallest-rotation-with-highest-score/solution/bao-li-po-jie-qu-jian-fu-gai-by-xiao-bai-0c6p/
var bestRotation = function (nums) {
    // 保存结果
    let result = 0;
    // 记录保存数组长度
    let n = nums.length;
    // 记录移动K次 节点值等于下标的数量，默认数量都为0
    const normalArr = new Array(n).fill(0);
    // 记录每个节点的分数
    let tem = 0;
    for (let i = 0; i < n; i++) {
        if (nums[i] > i) {
            // 移动 n + i - nums[i]后，该节点值等于下标，所以 
            normalArr[n + i - nums[i]]++;
        } else {
            // 移动 i - nums[i]后，该节点值等于下标，所以 
            normalArr[i - nums[i]]++;
            // 记录初次的分数
            tem++;
        }
    }
    // 保存最高分数
    let max = tem;
    for (let K = 1; K < n; K++) {
        // 每次移动只需要判断这次移动 有多少数组变为不符合要求的，将原来的减去该参数即可
        tem = tem - normalArr[K - 1] + 1;
        // 只有当有更优解的时候 继续新的result
        if (tem > max) {
            max = tem;
            result = K;
        }
    }
    return result;
};
